DROP TABLE IF EXISTS `tab_empireaccount`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tab_empireaccount` (
  `id` int(11) NOT NULL auto_increment COMMENT '游戏区账号id',
  `accountId` int(11) unsigned zerofill NOT NULL COMMENT '所属游戏的主账号（account.tab_account) ',
  `name` varchar(255) NOT NULL COMMENT '主账号的账号名(同account.tab_account.username)',
  `clientModel` varchar(255) default NULL COMMENT '登录客户端机型',
  `version` varchar(255) default NULL COMMENT '游戏版本',
  `createTime` datetime NOT NULL COMMENT '账号注册时间',
  `totalLoginTimes` int(11) default NULL COMMENT '总登录次数',
  `lastlogintime` datetime default NULL COMMENT '上次登录时间',
  `ipAddress` varchar(255) default NULL COMMENT '最近一次登录ip地址',
  `serverid` varchar(255) default NULL COMMENT '所在游戏区名',
  `status` tinyint(4) default NULL COMMENT '账户是否有效（1：有效 0：无效） ',
  `onLineTime` int(11) default NULL COMMENT '账号总登陆时间（分钟）',
  `maxLevel` int(11) NOT NULL default '0' COMMENT '该账户所练角色的最高级别（也可以用来判断活跃程度）',
  `machinecode` int(11) default NULL,
  `channel` int(11) default '0' COMMENT '渠道',
  `systemName` varchar(50) default NULL COMMENT '系统名称',
  `systemVersion` varchar(50) default NULL COMMENT '系统版本',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `ix_servid_accountid` USING BTREE (`serverid`,`accountId`)
) ENGINE=InnoDB AUTO_INCREMENT=818086 DEFAULT CHARSET=utf8 COMMENT='君权游戏账户信息表';
